INSERT INTO `sh_notice` VALUES ('5639f2e7ea904282a3d2bc1040776307', '上海科技大学2017年企业导师招募计划', '<p>&nbsp;&nbsp;&nbsp;&nbsp;上海科技大学是一所由上海市人民政府与中国科学院共同举办、共同建设，由上海市人民政府主管的全日制普通高等学校，2013年9月30日经教育部批准同意正式建立。学校致力于服务国家经济社会发展战略，培养科技创新创业人才，提供科技解决方案及发挥思想库作用，积极投身高等教育改革，努力建设一所小规模、高水平、国际化的研究型、创新型大学。&nbsp; &nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;为了更好地实现我校培养创新创业人才的培养目标，贯彻科教与产业紧密结合的办学理念，致力于为在校生创造更多接触行业前沿以及行业领军人物的机会，创新校企合作人才培养机制，提高学生培养质量，营造校企之间人员互动、互利共赢的合作态势，学校诚意聘请来自业界的优秀人士担任我校学生企业导师。</p><p><img src=\"http://img1.shikee.com/try/2016/06/23/14381920926024616259.jpg_180x180.jpg\" style=\"max-width:100%;\"><br></p><p><br></p>', '2018-07-20 17:22:05', '0');
